export function randomMaze(grid, startNode, finishNode, stopNode) {

    if (!startNode || !finishNode || startNode === finishNode) {
      return false;
    }
    let walls = [];
    for (let row = 0; row < grid.length; row++) {
      for (let col = 0; col < grid[0].length; col++) {

        if(stopNode!=false) 
        if (Math.random() < 0.33) {
          walls.push([row, col]);
        }
      }
    }
    walls.sort(() => Math.random() - 0.5);
    return walls;
  }
